import React from 'react';
import './App.css';
import Header from './components/HeaderDir/Header';
import MainGame from './components/MainGameDir/MainGame';
import Sidebar from './components/SidebarDir/Sidebar';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="game-container">
        <MainGame />
        <Sidebar />
      </div>
    </div>
  );
}

export default App;
